import React, { useState, useEffect } from 'react';

const Card = ({ children, className = '' }) => (
  <div className={`bg-white rounded-lg shadow p-4 ${className}`}>
    {children}
  </div>
);

const Input = ({ ...props }) => (
  <input
    {...props}
    className="w-full px-4 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
  />
);

const Button = ({ onClick, children, disabled }) => (
  <button
    onClick={onClick}
    className={`px-4 py-2 rounded-lg text-white font-medium ${
      disabled 
        ? 'bg-gray-400 cursor-not-allowed' 
        : 'bg-blue-500 hover:bg-blue-600 active:bg-blue-700'
    }`}
    disabled={disabled}
  >
    {children}
  </button>
);

const PropertyAssessmentTool = () => {
  const [address, setAddress] = useState('');
  const [loading, setLoading] = useState(false);
  const [results, setResults] = useState(null);
  const [error, setError] = useState('');
  const [googleLoaded, setGoogleLoaded] = useState(false);

  // Replace with your actual API key
  const GOOGLE_API_KEY = 'YOUR_GOOGLE_API_KEY';

  useEffect(() => {
    // Load Google Maps JavaScript API
    const script = document.createElement('script');
    script.src = `https://maps.googleapis.com/maps/api/js?key=${GOOGLE_API_KEY}&libraries=places`;
    script.async = true;
    script.onload = () => setGoogleLoaded(true);
    document.body.appendChild(script);

    return () => {
      document.body.removeChild(script);
    };
  }, []);

  const analyzeProperty = async () => {
    if (!address.trim()) {
      setError('Please enter an address');
      return;
    }

    setError('');
    setLoading(true);

    try {
      const geocoder = new window.google.maps.Geocoder();
      const service = new window.google.maps.places.PlacesService(document.createElement('div'));

      // Geocode the address
      const geocodeResult = await new Promise((resolve, reject) => {
        geocoder.geocode({ address }, (results, status) => {
          if (status === 'OK') resolve(results[0]);
          else reject(status);
        });
      });

      const location = geocodeResult.geometry.location;
      const lat = location.lat();
      const lng = location.lng();

      // Get nearby places
      const nearbyPlaces = await new Promise((resolve, reject) => {
        service.nearbySearch({
          location: { lat, lng },
          radius: 1500,
        }, (results, status) => {
          if (status === 'OK') resolve(results);
          else reject(status);
        });
      });

      // Calculate scores
      const poiCategories = {
        shopping: 0,
        restaurant: 0,
        school: 0,
        park: 0,
        transport: 0
      };

      nearbyPlaces.forEach(place => {
        place.types.forEach(type => {
          if (type.includes('shop') || type.includes('store')) poiCategories.shopping++;
          if (type.includes('restaurant') || type.includes('food')) poiCategories.restaurant++;
          if (type.includes('school')) poiCategories.school++;
          if (type.includes('park')) poiCategories.park++;
          if (type.includes('transit') || type.includes('transport')) poiCategories.transport++;
        });
      });

      const poiScore = Math.min(200, 
        (poiCategories.shopping * 10) +
        (poiCategories.restaurant * 10) +
        (poiCategories.school * 15) +
        (poiCategories.park * 15) +
        (poiCategories.transport * 10)
      );

      // Get place details
      const placeId = geocodeResult.place_id;
      const placeDetails = await new Promise((resolve, reject) => {
        service.getDetails({
          placeId,
          fields: ['rating', 'user_ratings_total', 'formatted_address']
        }, (result, status) => {
          if (status === 'OK') resolve(result);
          else reject(status);
        });
      });

      const averageRating = placeDetails.rating || 0;
      const totalRatings = placeDetails.user_ratings_total || 0;

      const sentimentScore = Math.min(200, Math.round((averageRating / 5) * 150 + 
        Math.min(50, totalRatings / 10)));

      setResults({
        poi: {
          score: poiScore,
          details: poiCategories
        },
        sentiment: {
          score: sentimentScore,
          details: {
            averageRating: averageRating.toFixed(1),
            totalReviews: totalRatings,
            communityEngagement: totalRatings > 100 ? 'High' : totalRatings > 50 ? 'Medium' : 'Low'
          }
        },
        propertyDetails: {
          address: placeDetails.formatted_address,
          coordinates: { lat, lng },
          nearbyPOIs: nearbyPlaces.length
        }
      });
    } catch (error) {
      setError('Error analyzing property. Please check the address and try again.');
      console.error('Analysis error:', error);
    } finally {
      setLoading(false);
    }
  };

  const ScoreCard = ({ title, score, details }) => (
    <Card className="w-full mb-4">
      <div className="flex justify-between items-center mb-4">
        <h3 className="text-lg font-semibold">{title}</h3>
        <div className="text-2xl font-bold">{score}/200</div>
      </div>
      <div className="text-sm text-gray-600">
        {Object.entries(details).map(([key, value]) => (
          <div key={key} className="flex justify-between mt-1">
            <span>{key.replace(/([A-Z])/g, ' $1').trim()}:</span>
            <span className="font-medium">{value}</span>
          </div>
        ))}
      </div>
    </Card>
  );

  const calculateTotalScore = (results) => {
    return Object.values(results)
      .filter(category => typeof category.score === 'number')
      .reduce((total, category) => total + category.score, 0);
  };

  if (!googleLoaded) {
    return <div>Loading Google Maps...</div>;
  }

  return (
    <div className="max-w-4xl mx-auto p-4">
      <Card className="mb-8">
        <h2 className="text-2xl font-bold mb-4">Lennar Property Assessment Tool</h2>
        <div className="flex flex-col gap-4">
          <div className="flex gap-4">
            <Input
              type="text"
              placeholder="Enter property address"
              value={address}
              onChange={(e) => setAddress(e.target.value)}
            />
            <Button
              onClick={analyzeProperty}
              disabled={loading}
            >
              {loading ? 'Analyzing...' : 'Analyze Property'}
            </Button>
          </div>
          {error && (
            <div className="text-red-500 text-sm">{error}</div>
          )}
        </div>
      </Card>

      {results && (
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <ScoreCard
            title="Points of Interest"
            score={results.poi.score}
            details={results.poi.details}
          />
          <ScoreCard
            title="Sentiment Analysis"
            score={results.sentiment.score}
            details={results.sentiment.details}
          />

          <Card className="col-span-full">
            <h3 className="text-xl font-bold mb-4">Overall Assessment</h3>
            <div className="text-4xl font-bold mb-4">
              Total Score: {calculateTotalScore(results)}/1000
            </div>

            <div className="bg-blue-50 p-4 rounded-lg">
              <h4 className="font-semibold mb-2">Property Details:</h4>
              <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                <div>Address: {results.propertyDetails.address}</div>
                <div>Nearby POIs: {results.propertyDetails.nearbyPOIs}</div>
                <div>Coordinates: {results.propertyDetails.coordinates.lat}, {results.propertyDetails.coordinates.lng}</div>
              </div>
            </div>
          </Card>
        </div>
      )}
    </div>
  );
};

export default PropertyAssessmentTool;
